    false,nt"url": null,nt"notes": "The Republican River Basin is a very large
    watershed in west-central Kansas, eastern Colorado, Wyoming and southern Nebraska.
    This study was conducted to determine background levels of metals and organochlorine
    compounds in aquatic habitats in the Republican River basin, and to determine if
    these habitats or fisheries may have been negatively impacted by Department of the
    Interior irrigation projects or by other activities. The sampling was intended as
    a preliminary assessment of risk to fish and wildlife that use aquatic habitats
    in the basin. Sediment and/or fish samples were collected from 33 locations and
    analyzed for metals (aluminum, barium, beryllium, boron, cadmium, chromium, cobalt,
    copper, iron, lead, magnesium, manganese, molybdenum, nickel, silver, strontium,
    thallium, vanadium, and zinc) and organochlorine.",nt"license_title": "License
